        padding-left: 2vw;

        animation-name: fadeIn;
        animation-duration: 4s;
      }
      .title {
        font-weight : lighter;
        font-size: 30px;
        font-size: 4vh;
        padding-left: 2vw;
      }


      @keyframes fadeIn {
        from {}
